import React from 'react';
import { BrowserRouter as Router, Route, Switch} from 'react-router-dom';

function App() {
  return (

    <React.Fragment>

      <Router>
        <Switch>
          <Route exact path="/" component={Overview} />
          <Route path="/tasks" component={Tasks} />
        </Switch>
      </Router>

    </React.Fragment>

  );
}

export default App;
